<template>
  <div id="app">
    <z-mirror></z-mirror>
  </div>
</template>

<script>
  import moment from 'moment'
  import ZMirror from '@/components/ZMirror'
  import { EventBus } from './eventBus.js'
  import Mousetrap from 'mousetrap'
  import { general as config } from '../config.json'

  export default {
    name: 'app',
    components: {
      ZMirror
    },
    data () {
      return {
        bip: new Audio('data:audio/wav;base64,')
      }
    },
    mounted () {
      // moment
      moment.locale('fr')

      // event bus
      Mousetrap.bind('space', () => {
        if (config.sound) this.bip.play()
        EventBus.$emit('update:currentweather')
        EventBus.$emit('update:forecast')
        EventBus.$emit('update:chucknorrisfacts')
      })

      Mousetrap.bind('w', () => {
        if (config.sound) this.bip.play()
        EventBus.$emit('update:currentweather')
      })

      Mousetrap.bind('f', () => {
        if (config.sound) this.bip.play()
        EventBus.$emit('update:forecast')
      })
      Mousetrap.bind('c', () => {
        if (config.sound) this.bip.play()
        EventBus.$emit('update:chucknorrisfacts')
      })
    }
  }
</script>

